import '../css/about.css';
import { ABDULLAH_LOGO } from '../assets/files/abdullahLogo.png';
import { FACEBOOK_LOGO } from '../assets/files/facebook.png';
import { INSTAGRAM_LOGO } from '../assets/files/instagram.png';
import { LINKEDIN_LOGO } from '../assets/files/linkedin.png';


const Footer = (props) => {

    return (
        <div className="footer">
            <section id="footer">
                <section id="footer-section">
                    <div class="low-row row">
                        <div class="copyright-row col-lg-12">
                            <img class="abdullah-logo" src={require(`../assets/files/.abdullahLogo.png`)} alt="missing asset" />
                        </div>
                    </div>
                    <div class="footer-icon row row">
                        <div class="footer-icon-row col-lg-12">
                            <a href="https://www.facebook.com"><img class="footer-social" src={ FACEBOOK_LOGO } alt="missing asset" /></a>
                            <a href="https://www.instagram.com"><img class="footer-social" src={ INSTAGRAM_LOGO } alt="missing asset" /></a>
                            <a href="https://ca.linkedin.com"><img class="footer-social" src={ LINKEDIN_LOGO } alt="missing asset" /></a>
                            <p class="copyright-paragraph">Copyright 2019. All Rights Reserved.</p>
                        </div>
                    </div>
                </section>
            </section>
        </div>
    )
}

export default Footer;
